import React from 'react'
import './featured.scss'

const Featured = () => {
    return (
        <div className="featured">
            <img src="https://images.alphacoders.com/131/1319720.jpeg" alt="The Witcher" />
           
            <div className="info">

            <img src="./" alt="The Witcher"></img>
            </div>

        </div>
    )
}

export default Featured
